import React from 'react';

const List = (props) => {
    return (
        <>
            
            <li className="list-group-item list-group-item-action" >
                <div className='row'>
                    <div className='col-sm-2'>
                        <span className='listindex'>{props.showindex}.</span>
                    </div>
                    
                    <div className='col-sm-4'>
                        <span style={{marginLeft:'10%'}}>{props.listvalue}</span>
                    </div>
                    
                    
                    <div className='col-sm-2'> 
                        <button className="material-symbols-outlined btn btn-primary" style={{float:'right'}}>delete</button>  
                    </div>
                    
                </div>  
            </li>
        </>
    );
}
export default List;
